import App from './App';

function card(){
    return(
    <>
        <div className="cards">
            <div className="card">
                <img src="https://wallpapercave.com/uwp/uwp29267.jpeg" alt="mypic" className="card_img" />
                <div>
                    <span className="card_category"> AR Series</span>
                    <h3 className="card_title">Dark</h3>
                    <a href="https://www.netflix.com/in/title/80100172" target="_blank">
                        <button>Watch Now</button>
                    </a>
                </div>

            </div>
        </div>
    </>
    )
}

ReactDOM.render(<card />
